import React from "react";
import {BrowserRouter,Routes,Route,Link,Navlink} from "react-router-dom"
import Home from "./pages/home";
import Navbar from "./components/navbar";
import Football from "./pages/Football/football";
function App() {
  return (
    <BrowserRouter>
    <Navbar/>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/football" element={<Football/>}>
          <Route path="/football/pl" element={<Pl/>}/>
          <Route path="/football/laliga" element={<PL/>}/>
          <Route path="/football/bundesliga" element={<PL/>}/>
          <Route path="/football/seriea" element={<PL/>}/>
          <Route path="/football/ligue" element={<PL/>}/>
          <Route path="/football/saudi" element={<PL/>}/>
          <Route path="/football/mexican" element={<PL/>}/>
          <Route path="/football/mls" element={<PL/>}/>
          <Route path="/football/scottish" element={<PL/>}/>
          <Route path="/football/portugese" element={<PL/>}/>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
